import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { Star, Quote, ChevronLeft, ChevronRight, TrendingUp, Phone, MapPin } from 'lucide-react';

const ClientResults = () => {
  const [currentTestimonial, setCurrentTestimonial] = useState(0);

  const testimonials = [
    {
      name: "Jacob Guyatt",
      business: "Local Business Owner",
      quote: "Rankly360 helped my local business show up higher in Google search and on Maps within just a few months. Their team optimized my Google profile, handled all the technical stuff, and even helped me get more positive reviews. I’ve seen a big increase in calls and website visits since working with them. Highly recommend."
    },
    {
      name: "Ishaan Jogie",
      business: "Basketball Training Business",
      quote: "Rankly360 helped take my basketball training business to the next level. After working with Jacob, I started getting way more client inquiries through my website. He was super professional, easy to work with, and really knew what he was doing. Highly recommend if you’re looking to grow your business online."
    }
  ];

  const nextTestimonial = () => {
    setCurrentTestimonial((prev) => (prev + 1) % testimonials.length);
  };

  const prevTestimonial = () => {
    setCurrentTestimonial((prev) => (prev - 1 + testimonials.length) % testimonials.length);
  };

  return (
    <section className="py-20 bg-white">
      {/* Before & After Comparison */}
      <div className="max-w-5xl mx-auto px-4 mb-16">
        <h2 className="text-4xl md:text-5xl font-bold text-primary-900 text-center mb-4">Before & After: Real Local SEO Results</h2>
        <p className="text-lg text-gray-600 text-center mb-10 max-w-2xl mx-auto">
          See the dramatic difference our strategies make. Slide to compare a client's Google Map Pack rankings before and after working with Rankly360.
        </p>
        <div className="flex flex-col md:flex-row gap-8 items-center justify-center">
          <div className="flex-1 text-center">
            <div className="mb-2 font-semibold text-gray-700">Before</div>
            <img
              src="/images/eBHbpbY.gif"
              alt="Local SEO Map Rankings Before"
              className="rounded-2xl shadow-lg border border-gray-100 w-full max-w-md mx-auto"
              style={{objectFit: 'contain'}}
            />
          </div>
          <div className="flex-1 text-center">
            <div className="mb-2 font-semibold text-gray-700">After</div>
            <img
              src="/images/XMgbFwE.gif"
              alt="Local SEO Map Rankings After"
              className="rounded-2xl shadow-lg border border-gray-100 w-full max-w-md mx-auto"
              style={{objectFit: 'contain'}}
            />
          </div>
        </div>
      </div>
      <div className="container mx-auto px-4 sm:px-6 lg:px-8">
        {/* Section Header */}
        <motion.div 
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl md:text-5xl font-bold text-primary-900 mb-6">
            Proven Results
          </h2>
          <p className="text-xl text-gray-600 max-w-3xl mx-auto">
            Real clients, real rankings, real business growth
          </p>
        </motion.div>

        {/* Testimonial Carousel */}
        <div className="max-w-3xl mx-auto">
          <motion.div
            key={currentTestimonial}
            initial={{ opacity: 0, x: 50 }}
            animate={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.5 }}
            className="bg-gradient-to-br from-primary-50 to-orange-50 rounded-2xl p-8 md:p-12 relative"
          >
            {/* Quote Icon */}
            <div className="absolute top-8 right-8">
              <Quote className="w-12 h-12 text-orange-500/20" />
            </div>

            <div className="flex flex-col items-center text-center gap-6">
              <h3 className="font-bold text-gray-900 text-lg">
                {testimonials[currentTestimonial].name}
              </h3>
              <p className="text-gray-600 mb-2">
                {testimonials[currentTestimonial].business}
              </p>
              <blockquote className="text-xl text-gray-700 leading-relaxed italic">
                "{testimonials[currentTestimonial].quote}"
              </blockquote>
              <div className="flex items-center gap-1 justify-center mt-2">
                {[...Array(5)].map((_, i) => (
                  <Star key={i} className="w-5 h-5 text-orange-500 fill-current" />
                ))}
              </div>
            </div>
          </motion.div>
          {/* Carousel Controls */}
          <div className="flex justify-center mt-6 gap-4">
            <button
              onClick={prevTestimonial}
              className="p-2 rounded-full bg-white shadow hover:bg-orange-100 transition-colors"
              aria-label="Previous testimonial"
            >
              <ChevronLeft className="w-6 h-6 text-orange-500" />
            </button>
            <button
              onClick={nextTestimonial}
              className="p-2 rounded-full bg-white shadow hover:bg-orange-100 transition-colors"
              aria-label="Next testimonial"
            >
              <ChevronRight className="w-6 h-6 text-orange-500" />
            </button>
          </div>
        </div>

        {/* Stats Section */}
        <motion.div 
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="mt-20"
        >
          <div className="grid grid-cols-1 md:grid-cols-3 gap-8 max-w-4xl mx-auto">
            <div className="text-center">
              <div className="text-4xl font-bold text-primary-900 mb-2">500+</div>
              <div className="text-gray-600">Local Rankings Achieved</div>
            </div>
            <div className="text-center">
              <div className="text-4xl font-bold text-primary-900 mb-2">150+</div>
              <div className="text-gray-600">Happy Clients</div>
            </div>
            <div className="text-center">
              <div className="text-4xl font-bold text-primary-900 mb-2">30</div>
              <div className="text-gray-600">Day Average to Results</div>
            </div>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default ClientResults;
